import logo from './logo.svg';
import './App.css';


function MyButton() {
  return (
    <button className="Button">I'm a button</button>
  );
}

const user = {
  name: 'Alex Kalinin',
  imageUrl: {logo},
  imageSize: 90,
};

export default function App() {
  return (
    <div className="App">
      <div>
        <h1>{user.name}</h1>
      </div>
      <div>
        <img src={user.imageUrl}
        className="App-logo" 
        alt={"react logo" + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}></img>
      </div>
      <MyButton />
    </div>
  );
}
